import React from 'react'
import Img from '../../../atoms/atImg/index.js'
import Div from '../../../atoms/atDiv/index.js'
//import DivCodigo from '../../../atoms/atDivCodigo'
//import DivNaveg from '../../../atoms/atDivNaveg'
import Layout from '../../../moleculas/layout'
import MoHead from '../../../moleculas/moHead'
import * as Util from '../../../../controller/util.js';

const codigoAMP = function (props) {

  console.log('╔════════════════════╗');
  console.log('║  Tutorial - AMP    ║');
  console.log('╚════════════════════╝');

  var regiao = Util.validaProps(props.regiao , "RJ");
  var modo = Util.validaProps(props.modo, "html");

  return (
    <div>
      <MoHead 
        modo={modo} 
        title="REDIRECT com AMP" 
        description="Tutorial REDIRECT no AMP" 
        canonical="/tutorial/amp/redirect/"/>
      <Layout regiao={regiao} modo={modo} titulo="Tutoriais" categoria="SEO">
        <Div display="responcivo">
          <div className="coluna404">
          <h1>AMP</h1>
          <p>AMP é uma estrutura HTML de código aberto desenvolvida pelo AMP Open Source Project. Foi originalmente criado pelo Google como concorrente do Facebook Instant Articles e Apple News. O AMP é otimizado para navegação online móvel e visa ajudar as páginas da internet a carregar mais rapidamente.</p>
          <p>Pagina em costrução...</p>
          </div>
          <div>
            <Img 
              src="/static/assetsv5/img/codigo/logoamp.jpg"
              width="200px"
              height="200px"
              alt="Logo AMP"
              title="Logo AMP"
              class="ClassLogoAMP"
              modo={modo}>
            </Img>
          </div>
        </Div>
      </Layout>
      <style jsx>{`
        .h1{
          color : #000000;
        }
     `}</style>
    </div>
  )
}

export default codigoAMP
